import React from 'react';

const ImageBox = ({ImgUrl}) => {
		if(ImgUrl!==''){
				return(
					<img className='imagebox pa1' src={ImgUrl} alt='Please enter a valid URL.'/>
					)
			} else {
				return (<div/>)
			}
}

export default ImageBox;
